var express = require('express');
var mongo = require('mongodb');
var router = express.Router();
var ObjectId = require('mongodb').ObjectID;

var mongoDbMycons = 'mongodb://localhost:27017/MyconsWeb';
var categoriesCollection = 'Categories';
var myconsCollection = 'mycons';
var usersCollection = 'users';

router.post('/deleteAllAndUploadCategories', function(req, res, next) { //original register function
    var requestBody = req.body;
    var categoriesList = requestBody.data;

    var successMessage = "Success";
    var failMessage = "Fail";

    mongo.connect(mongoDbMycons, function (err, db) {
        //assert.equal(null, err);
        console.log('error: ' + err);
        categoriesList.forEach(function(element){
            var category = {
                id: element.id,
                name: element.name,
                image: ""
            };

            db.collection(categoriesCollection).insertOne(category, function (err, result) {
                console.log('err: ' + err);
            });
        });
        db.close();
        res.send(successMessage);
    });
});

router.post('/updateCategoryImage', function(req, res, next) {
    var requestBody = req.body;
    var categoryId = requestBody.categoryId;
    var categoryImage = requestBody.image;

    if (!categoryImage){
        res.send("image is missing");
    }

    var successMessage = "Success";
    var failMessage = "Fail";

    mongo.connect(mongoDbMycons, function (err, db) {
        //assert.equal(null, err);
        console.log('error: ' + err);
        db.collection(categoriesCollection).findAndModify({query: { id: categoryId }, update: {image: categoryImage}}, function (err, userObj) {
            db.close();
            res.send(successMessage);
        });

    });
});



module.exports = router;


